script: |
  super -f text -I q11762.spq | sort > q11762.out

inputs:
  - name: q11762.spq
    data: |
      SELECT ALL col1 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT NULL BETWEEN - col1 AND ( + CAST ( + col2 AS INTEGER ) ) / - col0 + - col2;
  - name: tab2

outputs:
  - name: q11762.out
    data: |
